/*Table structure for table `area_copy` */

DROP TABLE IF EXISTS `area_copy`;

CREATE TABLE `area_copy` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(200) NOT NULL,
  `caption` varchar(200) NOT NULL COMMENT '点击POI时显示文字，由手机服务端使用',
  `search_name` varchar(200) NOT NULL DEFAULT '' COMMENT '搜索POI时关键字，由手机服务端使用',
  `map_id` int(11) unsigned NOT NULL DEFAULT '0',
  `mall_id` int(11) unsigned NOT NULL DEFAULT '0',
  `refer_id` int(11) unsigned NOT NULL DEFAULT '0',
  `group_id` int(11) unsigned NOT NULL DEFAULT '0',
  `is_important` tinyint(1) NOT NULL DEFAULT '0',
  `a_type` int(11) DEFAULT NULL,
  `poi_id` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `map_id` (`map_id`),
  KEY `mall_id` (`mall_id`),
  KEY `group_id` (`group_id`)
) ENGINE=InnoDB AUTO_INCREMENT=94 DEFAULT CHARSET=utf8;

