/*Table structure for table `area_point` */

DROP TABLE IF EXISTS `area_point`;

CREATE TABLE `area_point` (
  `id` int(11) NOT NULL,
  `map_id` int(11) DEFAULT NULL,
  `area_id` int(11) DEFAULT NULL,
  `lon` double DEFAULT NULL,
  `lat` double DEFAULT NULL,
  `refer_id` int(11) DEFAULT NULL,
  `sort` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `area_point` */

/*Table structure for table `area_type` */

DROP TABLE IF EXISTS `area_type`;

CREATE TABLE `area_type` (
  `id` int(11) NOT NULL,
  `a_type` int(11) DEFAULT NULL,
  `type_name` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `area_type` */

/*Table structure for table `company` */

DROP TABLE IF EXISTS `company`;

CREATE TABLE `company` (
  `id` int(11) NOT NULL,
  `name` varchar(50) DEFAULT NULL,
  `type` char(1) DEFAULT NULL,
  `licence_code` varchar(50) DEFAULT NULL,
  `group_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `company` */

/*Table structure for table `device` */

DROP TABLE IF EXISTS `device`;

CREATE TABLE `device` (
  `id` int(11) NOT NULL,
  `refer_id` int(11) DEFAULT NULL,
  `mac` varchar(50) DEFAULT NULL,
  `mall_id` int(11) DEFAULT NULL,
  `enable` bit(1) DEFAULT NULL,
  `sn` varchar(50) DEFAULT NULL,
  `description` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `device` */

/*Table structure for table `gradation` */

DROP TABLE IF EXISTS `gradation`;

CREATE TABLE `gradation` (
  `id` int(11) NOT NULL,
  `name` varchar(50) DEFAULT NULL,
  `company_id` int(11) DEFAULT NULL,
  `parent_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `gradation` */

/*Table structure for table `infotable` */

