/*Table structure for table `storey` */

DROP TABLE IF EXISTS `storey`;

CREATE TABLE `storey` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `num` tinyint(4) NOT NULL DEFAULT '0' COMMENT '楼层号数字表示',
  `mall_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '所属商场ID',
  `group_id` int(11) unsigned NOT NULL DEFAULT '0',
  `refer_map_id` int(11) unsigned NOT NULL DEFAULT '0',
  `size` int(8) unsigned NOT NULL DEFAULT '0',
  `name` varchar(100) NOT NULL,
  `mdb_id` varchar(20) NOT NULL COMMENT '与地图mdb中的FloorID一致',
  `mdb_mapname` varchar(20) NOT NULL COMMENT '与地图mdb中的mapName对应，用于路径规划的地图配置',
  `floor_id` varchar(30) NOT NULL COMMENT 'floorsCfg中定义的楼层唯一ID',
  `info` varchar(50) DEFAULT NULL COMMENT '楼层信息',
  PRIMARY KEY (`id`),
  KEY `group_id` (`group_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

